import React from 'react';
import './MuscleMap.css'; // crée ce fichier pour ajouter du style si tu veux

const MuscleMapFull = ({ onSelect }) => {
  return (
    <svg
      viewBox="0 0 300 400"
      xmlns="http://www.w3.org/2000/svg"
      className="muscle-map-svg"
    >
      {/* DEMO: deux muscles visibles */}
      <circle
        cx="100"
        cy="100"
        r="30"
        fill="#a12c2c"
        className="quads"
        onClick={() => typeof onSelect === 'function' && onSelect('quads-left')}
      />
      <circle
        cx="200"
        cy="100"
        r="30"
        fill="#a12c2c"
        className="quads"
        onClick={() => typeof onSelect === 'function' && onSelect('quads-right')}
      />

      <circle
        cx="150"
        cy="200"
        r="20"
        fill="#a12c2c"
        className="abs"
        onClick={() => typeof onSelect === 'function' && onSelect('abs-right')}
      />
    </svg>
  );
};

export default MuscleMapFull;
